import React from 'react';
import '../styles/MainPage.css';

function MainPage() {
    return (
      <div className="main-page">
        <div className="menu-bar">
          <button className="menu-button active">Project Using Screen</button>
          <button className="menu-button">Photo Upload / Train</button>
        </div>
        <div className="upload-area">
          <button className="upload-button big">Upload Image</button>
          <button className="upload-button">Upload & Test</button>
        </div>
      </div>
    );
  }

export default MainPage;
